// PropTypes
// ==================

Category.propTypes = {
    location: P.any,
    history: P.any,
    actions: P.any,
};

// ==================
// Export
// ==================
const WrappedHorizontalRole = Form.create()(Category);
export default connect(
    (state) => ({
    }),
    (dispatch) => ({
        actions: bindActionCreators({ updateProductType,advertPosition,UpdatePosition,deletePosition,onChange,deleteImage,onOk ,adList,advertPositionList,UpdateOnline}, dispatch),
    })
)(WrappedHorizontalRole);
